import React from "react";

function ContactMe() {
  function contactBox(site, img, link) {
    return (
      <a href={link} target="_blank" rel="noopener noreferrer">
        <div className="contactBox">
          <img src={img} alt={site} />
          <p>{site}</p>
        </div>
      </a>
    );
  }
  return (
    <div>
      <h1>Contact Me</h1>
      {contactBox("Email", "", "mailto:jhartmann26@icloud.com")}
      {contactBox(
        "LinkedIn",
        "",
        "https://www.linkedin.com/in/john-hartmann-a64794159/"
      )}
    </div>
  );
}

export default ContactMe;
